import React, { Component } from 'react';

class SearchInfo extends Component {
    render(){
        const searchParams = this.props.searchParams;

        return (
            <div>
                <input type="text" name="From">{searchParams.from}</input>
                <input type="text" name="To">{searchParams.to}</input>
                <input type="text" name="Date">{searchParams.date}</input>
                <button>Search</button>
            </div>

        )
    }
}
export default SearchInfo;
